import React from 'react';

const Services = () => {
    return (
        <div>
            <section id="services">
                <div className="container my-5 py-5">
                    <div className="row">
                        <div className="col-12">
                                <h3 className="fs-5">Services</h3>
                                    <p className="lead  mb-4">

                                    </p>
                                    <button className="btn btn-light me-4 rounded pill px-4 py-2">Check out my gallery!</button>
                                    <button className="btn btn-light me-4 rounded pill px-4 py-2">Get in touch!</button>
                        </div>
                            
                    </div>
                </div>
            </section>
        </div>
    );
} 

export default Services;
